import React from 'react';
import propTypes from 'prop-types';

export const Button = ({ title }) => {
  return (
    <button
      style={{
        width: '100px'
      }}
    >
      {title ? title : 'Submit'}
    </button>
  );
}

Button.propTypes = {
  title: propTypes.func
};
